      "description": "<p>CELULAR M12 SM-M127F SAMSUNG</p><p>- Pantalla Infinity-V Display TFT de 6.5\" HD+ (720x1600)</p><p>- Procesador Exynos850 (8nm) Octa Core 2.0Ghz</p><p>- Memoria RAM 4GB</p><p>- Almacenamiento interno 128GB</p><p>- Expandible hasta 1TB con tarjeta MicroSD</p><p>- Android</p><p>- Cámara Trasera Quad de 48MP + 5MP (UW)+ 2MP (M) + 2MP (D)</p><p>- Cámara Frontal 8MP</p><p>- Reproducción de Video FHD (1920x1080) @30fps</p><p>- WiFi 802.11 b/g/n 2.4GHz</p><p>- Bluetooth v5.0</p><p>- USB Type-C</p><p>- Earjack 3.5mm Stereo</p><p>- GPS, Glonass, Beidou, Galileo</p><p>- Sensores: Accelerometer, Fingerprint Sensor, Virtual Light Sensing, Virtual Proximity Sensing</p><p>- Desbloqueo con Huella Dactilar (Lateral)</p><p>- Reconocimiento Facial</p><p>- Sonido potente con Dobly Atmos (con Auriculares)</p><p>- Formatos de reproducción de Video: MP4, M4V, 3GP, 3G2, AVI, FLV, MKV, WEBM</p><p>- Formatos de reproducción de Audio: MP3, M4A, 3GA, AAC, OGG, OGA, WAV, AMR, AWB, FLAC, MID, MIDI, XMF, MXMF, IMY, RTTTL, RTX, OTA</p><p>- Incluye: Cargador, Data Cable, Guía deInicio Rápido, Eject Pin</p><p>- Batería 5000mAh para mayor duración y 15W Fast charging</p><p>- Medidas: 164.0x75.9x9.7mm</p><p>- Peso: 214gr</p><p>- Color Azul</p><p>- Modelo M12 SM-M127F</p><p>- Garantía fabricante 12 meses</p><p>- Origen Argentina</p><br><p>---------------------------------</p><br><p>¿CÓMO COMPRAR EN LA TIENDA?</p><br><p>1) Revisá las características del producto y hacenos todas las consultas que creas necesarias antes de comprar.</p><br><p>2) Efectuá la compra siguiendo los pasos que te indica Mercado Libre. Procurá revisar producto, cantidad, forma de pago y dirección de envío antes de confirmarla.</p><p>Al momento de recibir tus datos, reservaremos el producto para vos. Tené en cuenta que tendrás 7 días para concretar el correspondiente pago. Pasado ese lapso de tiempo, nos veremos obligados a cancelar la reserva del producto y a calificar la operación como \"no concretada\".</p><br><p>---------------------------------</p><br><p>FORMAS DE ENTREGA</p><br><p>Podes optar por retirar tu producto en cualquiera de nuestras sucursales o puntos de retiro disponibles de manera gratuita, o elegir la opción de envío a domicilio (puede tener costo).</p><br><p>ENVÍOS A DOMICILIO</p><br><p>¿Cuáles son las formas de envío disponibles?</p><p>Los productos adquiridos en nuestra tienda se envían exclusivamente a domicilio, a través del servicio provisto por varias empresas de logística privadas.</p><br><p>¿Cuál es el costo del envío?</p><p>Dependiendo de la oferta de que se trate, el costo de envío podrá serte bonificado. Esto se indicará en la publicación, de manera destacada. De lo contrario, el mismo se calculará de acuerdo con el peso / tamaño del producto, y de la localidad a la que deba ser enviado. Podes estimarlo ingresando tu código postal en la parte superior de esta publicación. De todas maneras, en el proceso de compra, el monto correspondiente a este concepto te será claramente informado.</p><br><p>¿Cómo realizo el seguimiento del envío de mi producto?</p><p>Una vez que confirmes tu compra, recibirás un email con un detalle de la misma, más un link para que puedas hacer el seguimiento.</p><br><p>El cumplimiento de la fecha de entrega, puede verse afectado por cuestiones de fuerza mayor que exceden a la compañía.</p><br><p>---------------------------------</p><br><p>RETIRO EN SUCURSAL MEGATONE</p><br><p>Podes retirar tu producto 24 hs después de haber recibido tu factura de compra!</p><br><p>------ BUENOS AIRES</p><p>* LA PLATA</p><p>* MAR DEL PLATA</p><p>* NECOCHEA</p><br><p>------ CATAMARCA</p><br><p>------ CHACO</p><p>* RESISTENCIA</p><br><p>------ CÓRDOBA</p><p>* ALTA GRACIA</p><p>* CARLOS PAZ</p><p>* CÓRDOBA</p><p>* COSQUÍN</p><p>* JESÚS MARÍA</p><p>* LA FALDA</p><p>* RÍO CEBALLOS</p><p>* RÍO CUARTO</p><p>* RÍO SEGUNDO</p><p>* RÍO TERCERO</p><p>* SAN FRANCISCO</p><p>* SANTA ROSA DE CALAMUCHITA</p><p>* VILLA DOLORES</p><p>* VILLA MARÍA</p><br><p>------ CORRIENTES</p><br><p>------ LA PAMPA</p><p>* GENERAL PICO</p><br><p>------ LA RIOJA</p><p>* AIMOGASTA</p><p>* CHILECITO</p><p>* LA RIOJA</p><p>* CHAMICAL</p><br><p>------ NEUQUÉN</p><br><p>------ RÍO NEGRO</p><p>* CIPOLLETTI</p><br><p>------ SALTA</p><br><p>------ SAN LUIS</p><p>* SAN LUIS</p><p>* VILLA MERCEDES</p><br><p>------ SANTA FE</p><p>* CAPITÁN BERMÚDEZ</p><p>* CERES</p><p>* RAFAELA</p><p>* ROSARIO</p><p>* SAN LORENZO</p><p>* SUNCHALES</p><br><p>------ SANTIAGO DEL ESTERO</p><p>* AÑATUYA</p><p>* FERNANDEZ</p><br><p>------ TUCUMÁN</p><br><p>---------------------------------</p><br><p>PREGUNTAS FRECUENTES</p><br><p>PRODUCTOS</p><br><p>¿Hay stock de todos los productos publicados en la Tienda Oficial?</p><p>Sí. Todos los productos que publicamos en nuestra Tienda Oficial cuentan con stock para realizar el envío de manera inmediata.</p><br><p>¿Los productos tienen garantía?</p><p>Sí. Todos los productos que comercializamos son originales y cuentan con la garantía de su fabricante o importador. Además, podes elegir extender la cobertura por hasta 5 años, con nuestro servicio Mega Protección.</p><br><p>¿El envío lo pago junto con el producto?</p><p>Si, pagás todo junto (producto + envío).</p><br><p>¿Hacen envíos a todo el país?</p><p>Si, excepto Tierra del Fuego.</p><br><p>¿En Cuánto tiempo se acredita una devolución?</p><p>Una vez que el producto esté nuevamente en Megatone, en un plazo de 72 hs hábiles aproximadamente, se realizará la devolución correspondiente a la tarjeta de crédito con la que pagaste.</p><br><p>PAGOS</p><br><p>¿Cómo puedo pagar mi compra?</p><p>Podés abonar tu compra a través de Mercado Pago, con cualquiera de las opciones que este sistema te ofrece</p><p>- Con tu tarjeta de crédito.</p><p>- En efectivo en puntos de pago.</p><p>- Con saldo pre-cargado en tu cuenta de MercadoPago.</p><br><p>¿Qué tipo de factura realizan?</p><p>Realizamos factura A o B, según corresponda.</p><p>En el caso de que necesites factura A, tené en cuenta que, por ser agentes de retención, puede ocurrir que debamos generar una percepción de Ingresos Brutos.</p><br><p>CAMBIOS Y DEVOLUCIONES POR FALLA DEL PRODUCTO</p><br><p>La devolución se acepta dentro de los DIEZ (10) días corridos contados a partir de la fecha de recibida la mercadería, sin costo alguno de devolución. Pasado este período debe contactarse con el service correspondiente.</p><p>No se aceptan cambios y devoluciones de productos usados o sin su envoltorio original. Los cambios se encuentran sujetos a disponibilidad de stock. Para recibir el nuevo producto o el reembolso correspondiente, primero deberás devolver el producto original.</p><br><p>IMPORTANTE</p><br><p>Solicitamos, en caso de tener algún inconveniente con tu compra, contactarnos por mensajería privada de Mercado Libre, esto nos permitirá solucionar tu problema de forma más rápida sin intermediarios. Estamos disponibles para resolver sus dudas y brindarle la mejor atención posible.</p><br>",
